const defaultNumberOfRooms = 4;
export const defaultRoomInfo = [
    { roomId: 0, title: 'Room 1' },
    { roomId: 1, title: 'Room 2' },
    { roomId: 2, title: 'Room 3' },
    { roomId: 3, title: 'Room 4' }
];
const createDefaultRooms = (current, index) => ({ roomId: index, title: `Room ${index + 1}` });
const ddri = Array.from({ length: defaultNumberOfRooms }, createDefaultRooms);
console.log(ddri)

